<script setup>
const { $gsap: gsap, $ScrollSmoother: ScrollSmoother } = useNuxtApp();

const localTl = ref(null);

onMounted(() => {
  setAnimation();
});

function setAnimation() {
   

  const world = document.querySelectorAll("#earth path");
  const sky = document.querySelectorAll("#sky path");
  const sat = document.querySelectorAll("#sky circle");
  const mainlines = document.querySelectorAll("#mainlines path");
  const sublines = document.querySelectorAll("#sublines path");
  const datacenters = document.querySelectorAll("#datacenters path");
  const filter = document.querySelectorAll("#glow feGaussianBlur");

  function weightedRandom(collection, ease) {
    return gsap.utils.pipe(
      Math.random, // random number between 0 and 1
      gsap.parseEase(ease), // apply the ease
      gsap.utils.mapRange(0, 1, -0.5, collection.length - 0.5), // map to the index range of the array, stretched by 0.5 each direction because we'll round and want to keep distribution (otherwise linear distribution would be center-weighted slightly)
      gsap.utils.snap(1), // snap to the closest integer
      (i) => collection[i] // return that element from the array
    );
  }

  const colors = [
    "#02f4c8",
    "#41bbf6",
    "#2dd4bf",
    "#34d399",
    "#06b6d4",
    "#0ea5e9",
  ];
  const randomColor = weightedRandom(colors, "linear");
  // gsap.set([datacenters, sat], { autoAlpha: 0 })

  function revealAnime() {
    gsap.set([world, datacenters, sat], {
      stroke: randomColor,
      strokeWidth: "0.3rem",
    });
    const anime = gsap.from([world, datacenters, sat], {
      drawSVG: 0,
      duration: 2.5,
      stagger: {
        each: 0.01,
        from: "center",
      },
      ease: "power1.inOut",
    });
    return anime;
  }

  function colorAnime() {
    const tl = gsap.timeline({
      defaults: { duration: 2.5 },
      repeat: -1,
      repeatDelay: 2,
      repeatRefresh: true,
      //  yoyo: true,
    });

    tl.to([mainlines, sublines, world], {
      fill: randomColor,
      autoAlpha: 0.7,
      stagger: {
        each: 0.02,
        from: "edges",
      },
      ease: "elastic",
    });
    tl.to([mainlines, sublines, world], {
      fill: "none",
      stroke: randomColor,
      autoAlpha: 1,
      stagger: {
        each: 0.02,
        from: "edges",
      },
      ease: "elastic",
    });
    return tl;
  }
  const blinkAnime = gsap.timeline({
    defaults: { duration: 1 },
    repeat: -1,
    yoyo: true,
    // repeatRefresh: true,
  });
  blinkAnime.to([datacenters, sat], {
    scale: 1.3,
    autoAlpha: 0.5,
    stroke: randomColor,
    transformOrigin: "50% 50%",
    strokeWidth: "0.15rem",
    stagger: {
      each: 0.02,
      from: "random",
    },
    ease: "elastic",
  });

  const glowAnime = gsap.timeline({
    defaults: { duration: 1 },
    repeat: -1,
    yoyo: true,
  });
  glowAnime.to(filter, {
    attr: { stdDeviation: 4 },
    ease: "power1.inOut",
    duration: 1.5,
  });

  function waveAnime() {
    gsap.set([sky, mainlines, sublines], {
      stroke: randomColor,
      strokeWidth: "0.3rem",
    });
    const tl = gsap.timeline({
      defaults: { duration: 5 },
      repeat: -1,
      yoyo: true,
    });
    tl.fromTo(
      [sky, mainlines, sublines],
      { drawSVG: 0 },
      {
        drawSVG: "73% 80%",
        ease: "sine.in",
      }
    ).to([sky, mainlines, sublines], {
      drawSVG: "100% 100%",
      strokeWidth: "0.2rem",
      ease: "sine.out",
    });
    return tl;
  }

   localTl.value = gsap
    .timeline({ defaults: { duration: 3 } })
    .add(revealAnime())
    .add(glowAnime)
    .add(colorAnime(), "-=1")
    .add(blinkAnime)
    .add(waveAnime(), "<");

  const hoverAnime = gsap.timeline({
    defaults: { duration: 2 },
    //  repeat: -1,
    paused: true,
    // yoyo: true,
  });
  hoverAnime.to([datacenters, sat], {
    scale: 1.5,
    transformOrigin: "center center",
    fill: randomColor,
    stroke: randomColor,
    strokeWidth: 4,
    stagger: {
      each: 0.01,
      from: "center",
    },
    ease: "bounce",
  });
  // console.log(sat)

  // datacenters.forEach(function (element) {
  //   element.addEventListener('mouseover', function () {
  //     hoverAnime.play()
  //   })

  //   element.addEventListener('mouseout', () => hoverAnime.reverse())
  // })
  // for each element in sat, add event listener for mouseenter and mouseleave

  // .to(
  //   '#world #datacenters path',
  //   {
  //     duration: 2,
  //     // rotation: 360,
  //     // scale: 0.5,
  //     // drawSVG: '100%',
  //     stroke: '#18FFFF',
  //     strokeWidth: 6,
  //     //  transformOrigin: '50% 50%',
  //   },
  //   1
  // )
  // .to('#world #datacenters path', {
  //   duration: 1,
  //   stroke: '#00E5FF',
  //   scale: 1.5,
  //   opacity: 0,
  //   stagger: 0.2,
  // })
}
function mouseover() {
  if ( localTl.value != null) {
    // this.localTl.timeScale(0.8)
  }
}
function mouseleave() {
  if ( localTl.value != null) {
    //  this.localTl.timeScale(1)
  }
}
</script>

